import React, { useState } from 'react';

const JournalForm = () => {
  const [formData, setFormData] = useState({
    date: '',
    content: '',
    mood_color: '',
    proper_nutrition: false,
    proper_hydration: false,
    hydration_amount: '',
    proper_exercise: false,
    exercise_duration: '',
    exercise_description: '',
    hours_of_sleep: '',
  });

  const handleChange = (e) => {
    const { name, value, type, checked } = e.target;
    setFormData({
      ...formData,
      [name]: type === 'checkbox' ? checked : value,
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    const csrfToken = document.querySelector('[name=csrfmiddlewaretoken]').value;

    try {
      const response = await fetch('/api/journal/', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
          'X-CSRFToken': csrfToken,  // Add CSRF token to request
        },
        body: JSON.stringify(formData),
      });

      if (response.ok) {
        console.log('Journal entry submitted successfully');
        // You can reset the form or display a success message here
      } else {
        console.error('Error submitting journal entry:', response.statusText);
      }
    } catch (error) {
      console.error('Error submitting form:', error);
    }
  };

  return (
    <form onSubmit={handleSubmit}>
      <input
        type="hidden"
        name="csrfmiddlewaretoken"
        value={document.querySelector('[name=csrfmiddlewaretoken]').value}
      />
      <div>
        <label>Date:</label>
        <input
          type="date"
          name="date"
          value={formData.date}
          onChange={handleChange}
        />
      </div>
      <div>
        <label>Content:</label>
        <textarea
          name="content"
          value={formData.content}
          onChange={handleChange}
        />
      </div>
      <div>
        <label>Mood color:</label>
        <select
          name="mood_color"
          value={formData.mood_color}
          onChange={handleChange}
        >
          <option value="#FFFF00">Happy</option>
          <option value="#0000FF">Sad</option>
          <option value="#FF0000">Angry</option>
          <option value="#00FF00">Relaxed</option>
          <option value="#808080">Neutral</option>
        </select>
      </div>
      <div>
        <label>Proper nutrition:</label>
        <input
          type="checkbox"
          name="proper_nutrition"
          checked={formData.proper_nutrition}
          onChange={handleChange}
        />
      </div>
      <div>
        <label>Proper hydration:</label>
        <input
          type="checkbox"
          name="proper_hydration"
          checked={formData.proper_hydration}
          onChange={handleChange}
        />
      </div>
      <div>
        <label>Hydration amount:</label>
        <input
          type="number"
          name="hydration_amount"
          value={formData.hydration_amount}
          onChange={handleChange}
        />
      </div>
      <div>
        <label>Proper exercise:</label>
        <input
          type="checkbox"
          name="proper_exercise"
          checked={formData.proper_exercise}
          onChange={handleChange}
        />
      </div>
      <div>
        <label>Exercise duration (in hours):</label>
        <input
          type="number"
          name="exercise_duration"
          value={formData.exercise_duration}
          onChange={handleChange}
        />
      </div>
      <div>
        <label>Exercise description:</label>
        <textarea
          name="exercise_description"
          value={formData.exercise_description}
          onChange={handleChange}
        />
      </div>
      <div>
        <label>Hours of sleep:</label>
        <input
          type="number"
          name="hours_of_sleep"
          value={formData.hours_of_sleep}
          onChange={handleChange}
        />
      </div>
      <button type="submit">Submit Journal Entry</button>
    </form>
  );
};

export default JournalForm;
